import React from 'react';
import '../Stylesheets/Header.css';

const Header = () => {
const cartItemQuantity = 'sdfsdf';
const cartWithQuantity = `Cart (${cartItemQuantity})`;
return (
<nav>
<ul>
<li><a href='/' className='shopping-header'>Shopping</a></li>
<li><a href='/'>Products</a></li>
<li><a href='/'>`${cartWithQuantity}`</a></li>
<li><a href='/'>`Cart (${cartItemQuantity})`</a></li>
</ul>
</nav>
);
}

export default Header;
